import React from "react";

const Search = ({ events }) => {
  return (
    <div id="search">
      <input
        type="text"
        id="searchInput"
        onChange={console.log("selam")}
        placeholder="Search a event..."
        value={events}
        required
      />
      <a id="searchIcon" href="www.google.com.tr">
        <i className="fas fa-search"></i>
      </a>
    </div>
  );
};

export default Search;
